export const design = {
  value:
    "",
  inlineText:
    "",
  title:
    "",
};

import { v4 as uuidv4 } from "uuid";

// Move uniqueId outside to avoid recreating on each call
const uniqueId = () => Number(Date.now() + Math.floor(Math.random() * 1000000));

// Function to generate consistent timestamps
const createTimestamp = () => new Date().toISOString();

export const uniqueUUID = () => {
  return uuidv4();
};

const createDish = (type, section, order, layout, placeholderTitle, column = 1) => {
  return {
    type,
    column,
    layout,
    section,
    placeholderTitle,
    id: uniqueId(),
    frontend_id: uniqueUUID(),
    addOns: null,
    created_at: createTimestamp(),
    description: null,
    isEdit: false,
    isSpacer: false,
    order_position: order,
    price: null,
    placeholderDescription: "Dish Description",
    placeholderPrice: "12",
    secondPrice: null,
    title: null,
    visible: false,
  };
};

export const defaultSection = (id, dishLayoutBlockId, sectionTitleLayoutBlockId, sectionId) => {
  return {
    id,
    sectionId,
    sectionTitleLayoutBlockId,
    sectionUniqueId: sectionId,
    columnMargin: 0,
    columns: 1,
    created_at: createTimestamp(),
    dish_layout: null,
    dishLayoutBlockId,
    dishes: [
      createDish("sectionTitle", sectionId, 0, design.title, "Unnamed Section"),
      createDish("dish", sectionId, 1, design.value, "Dish Title"),
      createDish("dish", sectionId, 2, design.value, "Dish Title"),
      createDish("dish", sectionId, 3, design.value, "Dish Title"),
    ],
    dndLayout: {
      h: 5,
      w: 1,
      x: 0,
      y: 0,
      i: sectionId,
    },
    isSaved: false,
    name: null,
    order_position: 0,
    page_id: 1,
    placeholderName: "Unnamed Section",
    position_bottom: 0,
    position_end: 0,
    position_start: 0,
    position_top: 0,
    title_layout: null,
  };
};
